import React from "react";
import "./assets/css/NavigationWithButton.css";
import "./assets/fonts/font-awesome.min.css";
import logoFreyss from "./assets/img/logoFreyss.png";
import logoInsta from "./assets/img/logoInsta.png";

class UINavBar extends React.Component {
  render() {
    return (
      <div
        style={{
          margin: "2px",
        }}
      >
        <nav className="navbar navbar-light navbar-expand-lg navigation-clean-button">
          <div className="container">
            <img
              src={logoFreyss}
              width={70}
              height={30}
              style={{
                marginLeft: "-4px",
              }}
            />
            <img
              className="img-fluid me-auto"
              src="assets/img/logo192.png"
              width={30}
              height={30}
              style={{
                marginRight: "0px",
                marginLeft: "20px",
              }}
            />
            <a
              href="https://www.instagram.com/freyssupport/"
              style={{
                marginRight: "4px",
                marginLeft: "9px",
              }}
            >
              <img src={logoInsta} width={30} height={30} />
            </a>
            <a
              className="navbar-brand text-start ms-auto"
              href="/"
              style={{
                marginRight: "16px",
                marginLeft: "0px",
              }}
            >
              <em>FreysSupport</em>
            </a>
            <div />
            <button
              data-bs-toggle="collapse"
              className="navbar-toggler"
              data-bs-target="#navcol-1"
            >
              <span className="visually-hidden">Toggle navigation</span>
              <span className="navbar-toggler-icon" />
            </button>
            <div className="collapse navbar-collapse" id="navcol-1">
              <span className="mx-auto navbar-text actions">
                <i
                  className="fa fa-search"
                  style={{
                    height: "16px",
                    margin: "7px",
                  }}
                />
                <input
                  type="search"
                  name="recherche"
                  placeholder="recherchez l'utilisateur"
                />{" "}
              </span>
              <a
                className="btn btn-primary border rounded-pill action-button"
                role="button"
                href="/signin"
                style={{
                  background: "rgb(33,88,116)",
                }}
              >
                Se connecter
              </a>
              <a
                className="btn btn-primary border rounded-pill"
                role="button"
                style={{
                  background: "rgb(33,88,116)",
                }}
                href="/signup"
              >
                S'inscrire
              </a>
              <button
                className="btn btn-primary border rounded-pill"
                type="button"
                style={{
                  background: "rgb(33,88,116)",
                }}
              >
                Log outÂ 
              </button>
            </div>
          </div>
        </nav>
      </div>
    );
  }
}

export default UINavBar;
